@Hua: could you explain how nodes will be registered at master if we removed registration code?'}, {'account_id': 11650, 'date': '2015-10-30 05:01:41.000000000', 'content': 'Patch Set 1: Code-Review+2'}, {'account_id': 11650, 'date': '2015-10-30 05:03:26.000000000', 'content': 'Patch Set 1: -Code-Review'}, {'account_id': 9591, 'date': '2015-10-30 05:31:59.000000000', 'content': "Patch Set 1: Code-Review-1

This script has two parts:  register and un-register.
It's true that with the current method for automatically registering a node by kubelet, the register part of the script is not used, but the un-register part is still being used when a node is removed from the cluster.  There is currently some problem with the un-register step and a bug has been opened against this.

In addition, we may need to modify the name registration in the near future to meet some requirements.  In this case, we will use the register part of the script again."}, {'account_id': 12053, 'date': '2015-10-30 08:23:53.000000000', 'content': 'Patch Set 1:

@Ton Ngo, when a node is removed from the cluster, k8s will mark it as "NotReady" and will not schedule pods onto this node. I think it is not necessary to delete it. Like nova, when a node is removed, the node still exists in db, but the status is unavailable. And I can't find where kube-register is called now.'}, {'account_id': 9591, 'date': '2015-10-30 08:37:27.000000000', 'content': 'Patch Set 1:

@Hua Wang: we can have 2 scenarios, (1) the node is removed permanently from the cluster because the cluster is resized, (2) the node is removed temporarily for maintenance and is expected to come back online.  In case (1), the Nova instance is deleted and will never be recreated with the same host name, so there is really no reason to keep the old entry in Kubernetes.  

If another Nova instance is added back to the cluster, it will have a different host name, so the name of the deleted instance will just remain in the "NotReady" status.'}, {'account_id': 9591, 'date': '2015-10-30 08:53:07.000000000', 'content': "Patch Set 1:

@Hua Wang, you are right, there seems to be a missing step in un-registering a node when it's removed from the cluster.  Egor has opened a bug on this:  

https://bugs.launchpad.net/magnum/+bug/1511570

I assigned it to myself, but I will be away until 11/9, so if you see the problem and would like to fix the bug, please feel free to pick it up."}, {'account_id': 8143, 'date': '2015-10-30 09:56:47.000000000', 'content': 'Patch Set 1: Code-Review+1

@Hua: I agree with Ton, we need to properly unregister nodes otherwise cluster state become messy from operation point of view.'}, {'account_id': 8143, 'date': '2015-10-30 10:14:27.000000000', 'content': 'Patch Set 1: Code-Review-1

